q($,"ai6","dY",function(){return H.d([T.rA("Time Spread","This spread is often used for a quick outline of the querent\u2019s past, present and future and gives a very simple and basic insight in what one would find in each time period.\n1. Past \u2013 This card represents the querent\u2019s past.\n2. Present \u2013 This card represents the querent\u2019s present.\n3. Future \u2013 This card represents the querent\u2019s future.",3,"assets/spread_time.png"),T.rA("Dream Spread","This spread is used when the querent inquires about dreams or dream interpretation. It\u2019s customary for the querent to tell the astrologian a brief description of the dream.\n1. How the dream is relevant to the querent\u2019s life.\n2. Lessons the dream is trying to teach the querrent.\n3. How the querent can apply the dream to their daily life.",3,"assets/spread_dream.png"),T.rA("Cross Spread","This spread is the most popular and is intended to shed light on many aspects of the querent\u2019s life. Due to its popularity, it is recommended that the querent focus intently on the question it wishes to ask the cards before the astrologian draws the cards into the spread. This can be done when the astrologian instructs the querent to shuffle and cut the cards.\n1. Signifier \u2013 represents the querent.\n2. Crossing \u2013 represents what is opposing the querrent.\n3. Foundation \u2013 represents the origin of the question.\n4. Recent Past \u2013 represents recent circumstances that contributed the querent to make their inquiry.\n5. Crown \u2013 represents the solution to the problem that may or may not come to pass in the future. This card foretells events depending on how the querent responds to the present situation.\n6. Future \u2013 represents what lies ahead.",6,"assets/spread_cross.png"),T.rA("Guide Spread","This spread is commonly used to answer very specific questions.\n1. Present situation\n2. Cause of conflicts\n3. Changes needed in order to face obstacles\n4. Strengths or Weaknesses\n5. Other challenges\n6. Outcome",6,"assets/spread_guide.png"),T.rA("Dawn Cross Spread","This spread is used to provide detailed information regarding a subject's fate.  The first card is placed in the center of the table; it is known as the 'core' and represents the querent's current state.  The second card is placed directly to the left of the first, and represents what, in the past, has exerted influence over the subject.  The third card is placed immediately to the right of the core and represents what will most affect the subject in the near future.  The fourth card is placed below the core, with the fifth card placed below the fourth.  These cards represent the misfortune the subject may face in the future, and the root of that misfortune respectively.  The sixth and final card is placed directly above the core, and represents the querent's overall fortune.",6,"assets/spread_dawn.png"),T.rA("Free Draw","Draw cards freely, with the cards at the top of the list being the most recently drawn",6,"assets/spread_free.png")],H.a4("u<AF*>"))})
